"279609":{"id":"279609","name":"Contos Clássicos da Galinha Pintadinha","slug":"contos-classicos-da-galinha-pintadinha","original_title":"Contos Clássicos da Galinha Pintadinha","overview":"Na hora de nanar na casa da Galinha, o Pintinho Amarelinho sempre pede para ler uma historinha. E assim, eles partem juntos para uma viagem mágica pelos maiores sucessos da literatura infantil.","first_air_date":"2023-11-12","episode_run_time":0,"vote_average":0,"number_of_seasons":1,"number_of_episodes":6,"created_by":[],"production_companies":["Warner Bros. Discovery Brasil"],"genres":["Família","Kids","Animação"],"certification":"L","backdrop_path":"https://image.tmdb.org/t/p/original/r4y34am5T4gKRrR15kbvsvhYorA.jpg","poster_path":"https://image.tmdb.org/t/p/original/7rO5VkNdJiH1MYX2AyHz3iWXZXO.jpg","cast":["Gabriela Vega"],"trailer":"N/A","seasons":{"1":{"name":"Season 1","poster_path":"https://image.tmdb.org/t/p/originalnull","backdrop_path":"https://image.tmdb.org/t/p/originalnull","air_date":"2023-11-12","episode_count":6,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Chapeuzinho Vermelho","overview":"A clássica história da menina que leva uma cesta de guloseimas para a vovó, mas encontra um lobo malvado pelo caminho. Uma lição sobre a importância de seguir os conselhos dos pais.","air_date":"2023-11-12","runtime":7,"still_path":"https://image.tmdb.org/t/p/original/rQpD8HMwtraT8LDX5ATRfjlgXSR.jpg","vote_average":0},"2":{"name":"Os Três Porquinhos","overview":"Descubra como três porquinhos constroem suas casas e enfrentam o lobo mau. Uma história que ensina sobre a importância do trabalho duro e da união.","air_date":"2023-11-12","runtime":7,"still_path":"https://image.tmdb.org/t/p/original/bPJTIyNxKafZI9KswIElHzHJybR.jpg","vote_average":0},"3":{"name":"O Patinho Feio","overview":"Um patinho diferente de todos os outros se sente sozinho e triste. Mas, com o tempo, ele descobre que é mais bonito do que imagina. Uma história sobre autoaceitação e a beleza da diversidade.","air_date":"2023-11-12","runtime":7,"still_path":"https://image.tmdb.org/t/p/original/f7wKvFzre7E4rAyZ6SyEeq6tBgo.jpg","vote_average":0},"4":{"name":"Cachinhos Dourados","overview":"A curiosa Cachinhos Dourados invade a casa dos três ursos e bagunça tudo. Uma história que ensina sobre a importância de respeitar a propriedade dos outros.","air_date":"2023-11-12","runtime":6,"still_path":"https://image.tmdb.org/t/p/original/cW0iDv02IqSlkrjgYrmqASeiFrN.jpg","vote_average":0},"5":{"name":"A Lebre e a Tartaruga","overview":"Uma lebre muito rápida e arrogante desafia uma tartaruga para uma corrida. Quem será que vai vencer? Uma história que mostra que a persistência é mais importante que a velocidade.","air_date":"2023-11-12","runtime":7,"still_path":"https://image.tmdb.org/t/p/original/pxi9upmSegVCNaVxAmnv1xVHebq.jpg","vote_average":0},"6":{"name":"A Cigarra e a Formiga","overview":"Enquanto a cigarra canta e se diverte, a formiga trabalha duro para guardar comida para o inverno. Uma história que ensina a importância da responsabilidade e do planejamento.","air_date":"2023-11-12","runtime":7,"still_path":"https://image.tmdb.org/t/p/original/li9ACNiuZrb5h4QqNL9weCYCdF8.jpg","vote_average":0}}}}},
